public class P686_RepeatedStringMatch {

    public int repeatedStringMatch(String A, String B) {
        if (A.indexOf(B) != -1) return 1;

        String twoA = A + A;
        if (twoA.indexOf(B) != -1) return 2;

        String twoB = B + B;
        if (twoB.indexOf(A) == -1) return -1;

        int m = A.length();
        int n = B.length();
        String after = B.replace(A, "_");
        if (after.equals("")) return n / m;

        int ans = 0;
        for (char ch : after.toCharArray()) {
            if (ch == '_') ans ++;
        }
        String[] z = after.split("_");
        int cnt = 0;
        for (String s : z) {
            if (s.equals("")) continue;

            if (A.indexOf(s) == -1) return -1;
            cnt++;
        }

        return ans + cnt;
    }


    public static void main(String[] args) {
        System.out.println(new P686_RepeatedStringMatch().repeatedStringMatch("abcd", "cdabcdab"));
        System.out.println(new P686_RepeatedStringMatch().repeatedStringMatch("abababaaba", "aabaaba"));
        System.out.println(new P686_RepeatedStringMatch().repeatedStringMatch("",
                ""));
    }
}
